import React from 'react';
import { Carousel } from 'antd';
import styled from 'styled-components';
import AppLayout from '../components/Applayout';

const Main = () => {
  return (
    <AppLayout>
      <Carousel effect="fade">
        <div style={{ textAlign: 'center', height: '160px', lineHeight: '160px', backgroundColor: '#364d79', overflow: 'hidden' }}>
          <h3>1</h3>
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
      </Carousel>
    </AppLayout>
  );
};

export default Main;
